CREATE TABLE kp_subscription_agreement  (
	SBSCAGRMIDNO    	int IDENTITY(1,1) NOT NULL,
	CLNTIDNO        	int NOT NULL,
	MAXXUSEDITEMCOUT	int NULL,
	AGRMNAME        	varchar(40) NULL,
	EXTNAGRMIDFC    	varchar(20) NULL,
	CUSTIDNO        	int NULL,
	CUSTVIEWALOW    	tinyint NOT NULL,
	CUSTEDITALOW    	tinyint NOT NULL,
	CUSTDLETALOW    	tinyint NOT NULL,
	VLIDFROMDATE    	datetime NULL,
	VLIDUNTLDATE    	datetime NULL,
	CUSTADDR        	varchar(50) NULL,
	CUSTNAME        	varchar(30) NULL,
	CUSTPOOFNAME    	varchar(25) NULL,
	CUSTPOOFNMBR    	varchar(12) NULL,
	CLNTZONEIDNO    	int NULL,
	MAXXITEMCOUT    	int NULL,
	INVCTYPENMBR    	tinyint NOT NULL,
	AGRMCMNT        	varchar(2000) NULL,
	MONDFROMTIME    	time NULL,
	MONDUNTLTIME    	time NULL,
	TUESFROMTIME    	time NULL,
	TUESUNTLTIME    	time NULL,
	WEDNFROMTIME    	time NULL,
	WEDNUNTLTIME    	time NULL,
	THURFROMTIME    	time NULL,
	THURUNTLTIME    	time NULL,
	FRIDFROMTIME    	time NULL,
	FRIDUNTLTIME    	time NULL,
	SATUFROMTIME    	time NULL,
	SATUUNTLTIME    	time NULL,
	SUNDFROMTIME    	time NULL,
	SUNDUNTLTIME    	time NULL
	);
SET IDENTITY_INSERT kp_subscription_agreement ON
;

